INSERT INTO `academic_works` (`id`, `seq_no`, `received_date`, `subject`, `related_person`, `summary`, `status_cause`, `responsible_person`, `created_at`, `updated_at`) VALUES
(1, '1', '2017-07-12', 'ออกหนังสือสำคัญสำหรับที่หลวงประเภทพลเมืองใช้ประโยชน์ ร่วมกัน แปลง \"ท่าควาย\" หมู่ที่ 4 ต.ศาลาแดงงานโครงการรังวัดออกหนังสือสำคัญสำหรับที่หลวงเพื่อความมั่นคงและการอนุรักษ์ที่ยั่งยืน เทิดไท้ 82 พรรษา มหาราชินี ปีงบประมาณ พ.ศ. 2560\r\n', 'เทศบาลตำบลศาลแดง อำเภอเมืองอ่างทอง(ผู้ขอ)\r\n', 'แจ้งอำเภอเมืองตรวจสอบกรณีรังวัดได้เนื้อที่ น้อยกว่า เดิม ตามหนังสือ ที่ อท 0020.4/23805 ลว. 28 ต.ค. 62- ขอทราบผลการดำเนินการ ตามหนังสือ ที่ อท0020.4/13000ลว. 9 มิ.ย.64 (ครั้งที่1), ที่ อท 0020.4/15420 ลว.6 ก.ค.65 (ครั้งที่ 2) ที่ อท 0020.4/20114 ลว. 9 ก.ย.65 (ครั้งที่ 3) แจ้งให้ดำเนินการภายใน 30 วันหากไม่มาจะจำหน่ายคำขอ \r\n', 'อำเภอและ อปท.ไม่ดำเนินการสอบและดำเนินการใดๆ ระเบียบไม่สามารถยกเลิกคำขอได้\r\n', 'พิชญธิดา', '2026-01-12 04:14:36', '2026-01-12 04:15:25');
